import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";

// PASTE YOUR BASE64 LOGO STRING HERE LATER
const TEMPLE_LOGO_BASE64 = "data:image/png;base64,"; 

const cleanText = (str) => {
  if (!str) return "";
  return String(str).replace(/[^\x00-\x7F]/g, "").trim();
};

const formatDateIN = (dateStr) => {
  if (!dateStr) return "-";
  if (dateStr.includes('.')) return dateStr; 
  const [y, m, d] = dateStr.split('-');
  if (!d || !m || !y) return dateStr; 
  return `${d}-${m}-${y}`;
};

const formatCurrencyIN = (amount) => {
  if (!amount) return "0";
  const str = Math.round(amount).toString();
  let lastThree = str.substring(str.length - 3);
  let otherNumbers = str.substring(0, str.length - 3);
  if (otherNumbers !== '') lastThree = ',' + lastThree;
  return otherNumbers.replace(/\B(?=(\d{2})+(?!\d))/g, ",") + lastThree;
};

export const generatePDFData = (donations, filterDetails) => {
  const doc = new jsPDF();

  // --- OFFICIAL HEADER LAYOUT ---
  
  if (TEMPLE_LOGO_BASE64) doc.addImage(TEMPLE_LOGO_BASE64, 'PNG', 14, 10, 25, 25);

  doc.setFont("times", "bold"); // SWITCHED TO TIMES NEW ROMAN
  doc.setTextColor(220, 80, 0); // Orange
  
  // Line 1: Purpose
  doc.setFontSize(10);
  doc.text("LIST OF DONORS FOR THE CONSTRUCTION OF", 105, 12, { align: "center" });

  // Line 2: Temple Name (The Main Focus)
  doc.setFontSize(16); // Bigger
  doc.text("SRI VENKATESWARA SWAMY TEMPLE", 105, 20, { align: "center" });

  // Line 3: Location
  doc.setFontSize(10);
  doc.text("YANAM - 533464", 105, 26, { align: "center" });

  // Sub-Header
  doc.setTextColor(0, 0, 0); // Black
  doc.text("Receipt Register Report", 105, 34, { align: "center" });

  // Filter Info
  doc.setFont("times", "normal"); 
  doc.setFontSize(10);
  doc.setTextColor(100, 100, 100);
  
  const today = new Date();
  const dateStr = `${String(today.getDate()).padStart(2,'0')}-${String(today.getMonth()+1).padStart(2,'0')}-${today.getFullYear()}`;
  
  doc.text(`Generated on: ${dateStr}`, 14, 42);
  doc.text(`Filter: ${filterDetails}`, 14, 47);

  // --- DATA ---
  const sortedData = [...donations].sort((a, b) => a.date.localeCompare(b.date));
  
  const tableRows = sortedData.map(item => [
    formatDateIN(item.date), 
    item.sl_no || "-",
    item.receipt_no || "-",
    cleanText(item.donor_name),
    formatCurrencyIN(item.amount) 
  ]);

  const totalAmount = donations.reduce((sum, item) => sum + (parseFloat(item.amount) || 0), 0);

  // --- TABLE ---
  autoTable(doc, {
    startY: 52,
    // CHANGED COLUMN NAME HERE
    head: [['Date', 'Sl No', 'Receipt No.', 'Name & Address', 'Amount (Rs)']], 
    body: tableRows,
    theme: 'grid',
    headStyles: { 
        fillColor: [220, 80, 0], 
        textColor: 255, 
        fontStyle: 'bold', 
        halign: 'center',
        font: 'times' // Match Font
    },
    styles: { 
        fontSize: 10, 
        cellPadding: 3, 
        valign: 'middle', 
        overflow: 'linebreak', 
        fontStyle: 'bold', 
        textColor: 20,
        font: 'times' // Match Font
    },
    columnStyles: {
      0: { cellWidth: 23 }, // Reduced slightly
      1: { cellWidth: 15 }, 
      2: { cellWidth: 25 }, // Increased for "Receipt No."
      3: { cellWidth: 'auto' }, 
      4: { cellWidth: 28, halign: 'right' } // Reduced slightly
    },
  });

  // --- GRAND TOTAL ---
  const finalY = doc.lastAutoTable.finalY; 
  
  if (finalY > 270) {
    doc.addPage();
    doc.text(`GRAND TOTAL:  Rs. ${formatCurrencyIN(totalAmount)} /-`, 195, 20, { align: "right" });
  } else {
    doc.setFontSize(12);
    doc.setFont("times", "bold");
    doc.setTextColor(0, 0, 0);
    doc.text(`GRAND TOTAL:  Rs. ${formatCurrencyIN(totalAmount)} /-`, 195, finalY + 10, { align: "right" });
  }

  return doc.output('datauristring');
};